import { useQuery } from 'react-query'
import { useParams } from 'react-router-dom'
import GNB from 'routes/_shared/GNB'
import { getSearchBookDetailApi } from 'services/bookSearchApi'

const BookDetail = () => {
  const paramValue = useParams()
  console.log(paramValue)

  const { data } = useQuery(
    ['getSearchBookDetailApi', paramValue],
    () => getSearchBookDetailApi(String(paramValue), 'isbn').then((res) => res.data),
    {
      enabled: !!paramValue,
    }
  )
  console.log(data)
  return (
    <div>
      <GNB />
      <div>{String(paramValue)}</div>
    </div>
  )
}

export default BookDetail
